import {Route, Routes} from "react-router-dom";

import inputFood from "./components/FoodSearchBar.js";
import displayFood from "./components/DisplayFood.js";

export default function App() {
    return (
      <div>
        <Routes>
        <Route exact path ="/" element={<displayFood />} />
          <Route exact path ="/addFood" element={<inputFood />} />
        </Routes>
      </div>
    );
}
